import React from 'react';

const CategoryList = ({ categories }) => {
    return (
        <div>
            <h2>Categories</h2>
            <ul>
                {categories.map((category) => (
                    <li key={category._id}>{category.title}</li>
                ))}
            </ul>
        </div>
    );
};

export default CategoryList;
